<h1>JARVIS ULTIMATE SYSTEM</h1>
</header>

<section>
<h2> Suivi Poids</h2>
<input type="number" id="weightInput" placeholder="Entrer poids (kg)">
<button onclick="addWeight()">Ajouter</button>
<canvas id="weightChart"></canvas>
</section>

<section>
<h2> Calcul Dficit</h2>
<input type="number" id="calInput" placeholder="Calories aujourd'hui">
<button onclick="calcDeficit()">Calculer</button>
<div class="card" id="deficitResult"></div>
</section>

<section>
<h2> Programme 4 Jours</h2>
<select id="daySelect">
<option>Pectoraux / Triceps</option>
<option>Dos / Biceps</option>
<option>Jambes</option>
<option>paules / Abdos</option>
</select>
<textarea id="trainingNotes" placeholder="Notes sance..." style="width:100%;height:80px;"></textarea>
<button onclick="saveTraining()">Sauvegarder</button>
<div class="card" id="trainingDisplay"></div>
</section>

<section>
<h2> Cheat Meal Engine</h2>
<button onclick="logCheat()">Enregistrer Cheat Meal</button>
<div class="card" id="cheatDisplay"></div>
</section>

<section>
<h2> Mode Ramadan</h2>
<button onclick="toggleRamadan()">Activer / Dsactiver</button>
<div class="card" id="ramadanStatus"></div>
</section>

<script>
let weightData = JSON.parse(localStorage.getItem("weights") || "[]");
const ctx = document.getElementById('weightChart').getContext('2d');
const weightChart = new Chart(ctx, {
    type: 'line',
    data: {
        labels: weightData.map((_,i)=>"Entre "+(i+1)),
        datasets: [{ label: 'Poids (kg)', data: weightData, borderColor: '#f59e0b', fill:false }]
    }
});

function addWeight(){
    let w = document.getElementById("weightInput").value;
    if(!w) return;
    weightData.push(parseFloat(w));
    localStorage.setItem("weights", JSON.stringify(weightData));
    weightChart.data.labels.push("Entre "+weightData.length);
    weightChart.data.datasets[0].data.push(w);
    weightChart.update();
}

function calcDeficit(){
    let maintenance = 2300;
    let today = parseInt(document.getElementById("calInput").value);
    let diff = maintenance - today;
    document.getElementById("deficitResult").innerText = "Dficit estim : " + diff + " kcal";
}

function saveTraining(){
    let day = document.getElementById("daySelect").value;
    let notes = document.getElementById("trainingNotes").value;
    localStorage.setItem("training_"+day, notes);
    document.getElementById("trainingDisplay").innerText = day + " : " + notes;
}

function logCheat(){
    localStorage.setItem("cheat", new Date().toLocaleDateString());
    document.getElementById("cheatDisplay").innerText = "Cheat meal enregistr le " + new Date().toLocaleDateString();
}

function toggleRamadan(){
    let status = localStorage.getItem("ramadan");
    if(status==="on"){
        localStorage.setItem("ramadan","off");
        document.getElementById("ramadanStatus").innerText="Mode Ramadan dsactiv";
    } else {
        localStorage.setItem("ramadan","on");
        document.getElementById("ramadanStatus").innerText="Mode Ramadan activ";
    }
}
</script>

</body>
</html>
